import React from "react";
import "./form.scss";

// This file exports the Input and FormBtn components

export function Input(props) {
  return (
    <div>
      <input {...props} />
    </div>
  );
}

export function FormBtn(props) {
  return (
    <button {...props}>
        Search
    </button>
  );
}
